function createTimer(name, minutes){
  const timers = $('.timers');
  const timerDiv = $('&lt;div&gt;');
  const nameSpan = $('&lt;span&gt;');
  const timerSpan = $('&lt;span&gt;');
  timerSpan.attr('class','timer');

  const seconds = parseInt(minutes) * 60;

  nameSpan.text(name+': ');
  timerSpan.text(getTimeFromSeconds(seconds));
  timerDiv.append(nameSpan).append(timerSpan);
  timers.append(timerDiv);
}

function getTimeFromSeconds(timeInSeconds){
  let minutes = Math.floor(timeInSeconds/60);
  let seconds = timeInSeconds % 60;
  if(minutes &lt; 10 ){
    minutes = '0' + minutes;
  }

  if(seconds &lt; 10){
    seconds = '0' + seconds;
  }
  return `${minutes}:${seconds}`;
}

function getSecondsFromTime(time){
  var arr = time.split(':');
  return parseInt(arr[0] * 60) + parseInt(arr[1]);
}

