function generateDeck() {
  const suits = ["Hearts", "Diamonds", "Spades", "Clovers"];
  const faces = ["Ace", 2, 3, 4, 5, 6, 7, 8, 9, 10, "Jack", "Queen", "Kings", "Joker"]

  var deck = [];

  for (var i = 0; i &lt; faces.length - 1; i++) {
    for (var j = 0; j &lt; suits.length; j++) {
      deck.push(faces[i] + " of " + suits[j]);
    }
  }

  deck.push(faces[faces.length - 1]);

  return deck;
}

//Shuffle a provided deck one time or more if provided a second argument.
function shuffleDeck(inputDeck, numTimes = 1) {
  //Create a copy of the inputDeck;
  var deck = [...inputDeck];
  //Create a shuffled array that will contain the final result
  var shuffled = [];
  var deckLenAtStart = deck.length;

  //Shuffle the number of times provided as the second function argument
  for (var shuffleTimes = 0; shuffleTimes &lt; numTimes; shuffleTimes++) {

    //Don't swap these the first iteration, only used for multiple shuffles
    if (shuffleTimes &gt; 0) {
      deck = [...shuffled];
      shuffled = [];
    }

    //Loop through the entire deck, generate a random number from 0 to the length of the
    //deck, push the result to the shuffled deck, remove the result from original deck
    for (var i = 0; i &lt; deckLenAtStart; i++) {
      rand = Math.floor(Math.random() * deck.length);
      shuffled.push(deck[rand]);
      deck.splice(rand, 1);

    }
  }

  return shuffled;
}

